import React from "react";
import './main.css'

function Footer() {
    return (
        <div className="footer">
            <footer className="footer-padding bg-dark fixed-bottom">
                <div className="container">
                    <p className="m-0 text-center text-white">
                        Copyright &copy; BikeRoom 2022
                    </p>
                </div>
            </footer>
        </div>
    );
}

export default Footer;
